local function GetItemName(itemID)
    return itemIDToItemName[itemID] or "Unnamed Item";
end

NarciItemDatabase.GetItemName = GetItemName;


local function GetFlatList()
    local flatList = {}
    local i = 0;
    for itemID, name in pairs(itemIDToItemName) do
        i = i + 1;
        flatList[i] = itemID;
    end
    --print("Total Weapons: "..i)
    return flatList, i
end

NarciItemDatabase.GetFlatListFromItemNameDatabase = GetFlatList;